import { NextRequest, NextResponse } from 'next/server';
import prisma from '@/lib/prisma';

export async function GET(
  request: NextRequest,
  { params }: { params: Promise<{ id: string }> }
) {
  try {
    const { id } = await params;
    const chitFundId = parseInt(id);

    if (isNaN(chitFundId)) {
      return NextResponse.json(
        { error: 'Invalid chit fund ID' },
        { status: 400 }
      );
    }

    // Check if the chit fund exists
    const chitFund = await prisma.chitFund.findUnique({
      where: { id: chitFundId },
    });

    if (!chitFund) {
      return NextResponse.json(
        { error: 'Chit fund not found' },
        { status: 404 }
      );
    }

    // Get all contributions for this chit fund with member details
    const contributions = await prisma.contribution.findMany({
      where: {
        member: {
          chitFundId: chitFundId,
        },
      },
      include: {
        member: {
          select: {
            id: true,
            contribution: true,
            globalMember: {
              select: {
                name: true,
                contact: true,
                email: true,
              }
            }
          },
        },
      },
      orderBy: [
        { month: 'asc' },
        { paidDate: 'desc' },
      ],
    });

    return NextResponse.json(contributions);
  } catch (error) {
    /* eslint-disable */console.error(...oo_tx(`2025812160_56_4_56_57_11`,'Error fetching contributions:', error));
    return NextResponse.json(
      { error: 'Failed to fetch contributions' },
      { status: 500 }
    );
  }
}

export async function POST(
  request: NextRequest,
  { params }: { params: Promise<{ id: string }> }
) {
  try {
    const { id } = await params;
    const chitFundId = parseInt(id);

    if (isNaN(chitFundId)) {
      return NextResponse.json(
        { error: 'Invalid chit fund ID' },
        { status: 400 }
      );
    }

    const body = await request.json();

    // Validate required fields
    const requiredFields = ['memberId', 'month', 'amount', 'paidDate'];
    for (const field of requiredFields) {
      if (!body[field]) {
        return NextResponse.json(
          { error: `${field} is required` },
          { status: 400 }
        );
      }
    }

    // Check if the chit fund exists
    const chitFund = await prisma.chitFund.findUnique({
      where: { id: chitFundId },
    });

    if (!chitFund) {
      return NextResponse.json(
        { error: 'Chit fund not found' },
        { status: 404 }
      );
    }

    // Check if the member exists and belongs to this chit fund
    const member = await prisma.member.findFirst({
      where: {
        id: body.memberId,
        chitFundId: chitFundId,
      },
    });

    if (!member) {
      return NextResponse.json(
        { error: 'Member not found or does not belong to this chit fund' },
        { status: 404 }
      );
    }

    // Check if the month is valid
    if (body.month < 1 || body.month > chitFund.duration) {
      return NextResponse.json(
        { error: `Month must be between 1 and ${chitFund.duration}` },
        { status: 400 }
      );
    }

    // Check if a contribution for this member and month already exists
    const existingContribution = await prisma.contribution.findFirst({
      where: {
        memberId: body.memberId,
        month: body.month,
      },
    });

    if (existingContribution) {
      return NextResponse.json(
        { error: 'A contribution for this member and month already exists' },
        { status: 400 }
      );
    }

    // Calculate balance if the amount is less than the expected monthly contribution
    let balance = 0;
    let balancePaymentStatus = null;

    if (body.amount < chitFund.monthlyContribution) {
      balance = chitFund.monthlyContribution - body.amount;

      // Set default status to "Pending"
      balancePaymentStatus = "Pending";

      // If status is provided and is "Paid", set balance to 0
      if (body.balancePaymentStatus === "Paid") {
        balancePaymentStatus = "Paid";
        balance = 0;
      }
    }

    // Create the contribution
    const contribution = await prisma.contribution.create({
      data: {
        memberId: body.memberId,
        month: body.month,
        amount: body.amount,
        paidDate: new Date(body.paidDate),
        chitFundId: chitFundId,
        balance: balance,
        balancePaymentDate: body.balancePaymentDate ? new Date(body.balancePaymentDate) : null,
        balancePaymentStatus: balancePaymentStatus,
        actualBalancePaymentDate: body.actualBalancePaymentDate ? new Date(body.actualBalancePaymentDate) : null,
      },
      include: {
        member: {
          select: {
            id: true,
            contribution: true,
            globalMember: {
              select: {
                name: true,
                contact: true,
                email: true,
              }
            }
          },
        },
      },
    });

    // Update the chit fund's current month if needed
    if (body.month > chitFund.currentMonth) {
      await prisma.chitFund.update({
        where: { id: chitFundId },
        data: { currentMonth: body.month },
      });
    }

    return NextResponse.json(contribution, { status: 201 });
  } catch (error) {
    /* eslint-disable */console.error(...oo_tx(`2025812160_173_4_173_56_11`,'Error creating contribution:', error));
    return NextResponse.json(
      { error: 'Failed to create contribution' },
      { status: 500 }
    );
  }
}

export async function PUT(
  request: NextRequest,
  { params }: { params: Promise<{ id: string }> }
) {
  try {
    const { id } = await params;
    const chitFundId = parseInt(id);

    if (isNaN(chitFundId)) {
      return NextResponse.json(
        { error: 'Invalid chit fund ID' },
        { status: 400 }
      );
    }

    const body = await request.json();

    // Validate required fields
    const requiredFields = ['contributionId', 'amount', 'paidDate'];
    for (const field of requiredFields) {
      if (!body[field]) {
        return NextResponse.json(
          { error: `${field} is required` },
          { status: 400 }
        );
      }
    }

    // Check if the contribution exists and belongs to a member of this chit fund
    const existingContribution = await prisma.contribution.findFirst({
      where: {
        id: body.contributionId,
        member: {
          chitFundId: chitFundId,
        },
      },
      include: {
        member: true,
        chitFund: true,
      },
    });

    if (!existingContribution) {
      return NextResponse.json(
        { error: 'Contribution not found or does not belong to this chit fund' },
        { status: 404 }
      );
    }

    // Calculate balance if the amount is less than the expected monthly contribution
    let balance = 0;
    let balancePaymentStatus = null;

    if (body.amount < existingContribution.chitFund.monthlyContribution) {
      balance = existingContribution.chitFund.monthlyContribution - body.amount;

      // Determine balance payment status
      if (body.balancePaymentStatus) {
        balancePaymentStatus = body.balancePaymentStatus;

        // If status is "Paid", set balance to 0
        if (body.balancePaymentStatus === "Paid") {
          balance = 0;
        }
      } else if (balance > 0) {
        balancePaymentStatus = "Pending";
      }
    }

    // Update the contribution
    const updatedContribution = await prisma.contribution.update({
      where: { id: body.contributionId },
      data: {
        amount: body.amount,
        paidDate: new Date(body.paidDate),
        balance: balance,
        balancePaymentDate: body.balancePaymentDate ? new Date(body.balancePaymentDate) : null,
        balancePaymentStatus: balancePaymentStatus,
        actualBalancePaymentDate: body.actualBalancePaymentDate ? new Date(body.actualBalancePaymentDate) : null,
      },
      include: {
        member: {
          select: {
            id: true,
            contribution: true,
            globalMember: {
              select: {
                name: true,
                contact: true,
                email: true,
              }
            }
          },
        },
      },
    });

    return NextResponse.json(updatedContribution);
  } catch (error) {
    /* eslint-disable */console.error(...oo_tx(`2025812160_update_1_4_56_11`,'Error updating contribution:', error));
    return NextResponse.json(
      { error: 'Failed to update contribution' },
      { status: 500 }
    );
  }
}

export async function DELETE(
  request: NextRequest,
  { params }: { params: Promise<{ id: string }> }
) {
  try {
    const { id } = await params;
    const chitFundId = parseInt(id);

    if (isNaN(chitFundId)) {
      return NextResponse.json(
        { error: 'Invalid chit fund ID' },
        { status: 400 }
      );
    }

    const { contributionId } = await request.json();

    if (!contributionId) {
      return NextResponse.json(
        { error: 'Contribution ID is required' },
        { status: 400 }
      );
    }

    // Check if the contribution exists and belongs to a member of this chit fund
    const contribution = await prisma.contribution.findFirst({
      where: {
        id: contributionId,
        member: {
          chitFundId: chitFundId,
        },
      },
    });

    if (!contribution) {
      return NextResponse.json(
        { error: 'Contribution not found or does not belong to this chit fund' },
        { status: 404 }
      );
    }

    // Delete the contribution
    await prisma.contribution.delete({
      where: { id: contributionId },
    });

    return NextResponse.json({ message: 'Contribution deleted successfully' });
  } catch (error) {
    /* eslint-disable */console.error(...oo_tx(`2025812160_229_4_229_56_11`,'Error deleting contribution:', error));
    return NextResponse.json(
      { error: 'Failed to delete contribution' },
      { status: 500 }
    );
  }
}
